Program: |+1
 
 //this method calculates the necessary angles and other parameters in the lift 
 //to get a certain enterHeight and exitHeight
 
 ----------
 //PARAMETERS:
 var l := parallelStation
 var beamLength := beamLength
 var beamThickness := beamThickness
 var amountJoints := amountJoints
 var beamTolerance := shellThickness
 ----------
 
 --calc length of beams
 var lengthScale := beamLength/2 --orig length = 2
 var thickScale := beamThickness/0.2 --orig thick = 0.2
 
 --calc diff in height
 var diffHeight := (enterHeight - beamThickness)/amountJoints/2
 
 --calc angles in degrees
 --var h := ((enterHeight-beamThickness) - beamThickness)/amountJoints
 var totH := enterHeight-topThickness
 var h := totH / amountJoints
 var startAngle := asin(h/beamLength)*180/pi
 current.startAngle := startAngle
 
 --h := ((exitHeight-beamThickness) - beamThickness)/amountJoints
 totH := exitHeight - topThickness
 h := totH / amountJoints
 var endAngle := asin(h/beamlength)*180/pi
 current.endAngle := endAngle
 
 var longBeamLength := 2
 var shortBeamLength := 0.8
 var beamHeight := 0.2
 var topPlateCorrection := 0 --0.1
 
 //top plate
 var o := l._3d.getObject("topPlate")
 o.jointLowerLimit := enterHeight - topThickness
 o.jointUpperlimit := exitheight - topThickness
 --top plate graphics
 o := o.getGraphic("default", [1])
 o.scale := [(topLength-2*shellThickness)/longBeamLength,(topWidth-2*shellThickness)/1,topThickness/beamHeight]
 o.scale := [o.scale[1]*(1-topPlateCorrection), o.scale[2]*(1-topPlateCorrection), o.scale[3]] --makes different graphics to not "blend together"
 
 topPlateCorrection := 0
 
 //top shell
 var beamScaleZ := topThickness/beamHeight
 var shellThickScale := shellThickness/0.2
 o := l._3d.getObject("topPlate").getObject("topShellSouth")
 o.scale := [topLength/longBeamLength*(1+topPlateCorrection), shellThickScale, beamScaleZ]
 o.position := [0, -topWidth/2 + shellThickness/2, 0]
 o := l._3d.getObject("topPlate").getObject("topShellNorth")
 o.scale := [topLength/longBeamLength*(1+topPlateCorrection), shellThickScale, beamScaleZ]
 o.position := [0, topWidth/2 - shellThickness/2, 0]
 o := l._3d.getObject("topPlate").getObject("topShellWest")
 o.scale := [shellThickScale, (topWidth-shellThickness*2)/shortBeamLength*(1+topPlateCorrection), beamScaleZ]
 o.position := [-topLength/2 + shellThickness/2, 0, 0]
 o := l._3d.getObject("topPlate").getObject("topShellEast")
 o.scale := [shellThickScale, (topWidth-shellThickness*2)/shortBeamLength*(1+topPlateCorrection), beamScaleZ]
 o.position := [topLength/2 - shellThickness/2, 0, 0]
 
 //base objects
 beamScaleZ := topThickness/beamHeight - 0.1
 o := l._3d.getObject("baseSouth")
 o.scale := [topLength/longBeamLength,shellThickScale, beamScaleZ]
 o.position := [0,topWidth/2 - shellThickness/2,0] 
 o := l._3d.getObject("baseNorth")
 o.scale := [topLength/longBeamLength,shellThickScale, beamScaleZ]
 o.position := [0, - topWidth/2 + shellThickness/2,0] 
 o := l._3d.getObject("baseWest")
 o.scale := [shellThickScale, (topWidth-shellThickness*2)/shortBeamLength, beamScaleZ]
 o.position := [-topLength/2 + shellThickness/2, 0, 0] 
 o := l._3d.getObject("baseEast")
 o.scale := [shellThickScale, (topWidth-shellThickness*2)/shortBeamLength, beamScaleZ]
 o.position := [topLength/2 - shellThickness/2, 0, 0]
 
 //mu spot
 o := l._3d.getObject("topPlate").getObject("muSpot")
 o.jointLowerLimit := topLength/2*-1 - muLength/2
 o.jointUpperLimit := topLength/2 - muLength/2
 o.position[3] := topThickness - 0.01
 
 thickScale := beamThickness/0.2
 var mainRotCenter := [beamLength/2*-1, 0, 0] --beamThickness/2, beamThickness/2]
 var lowerRotCenter := [beamLength/2, 0, 0] --beamThickness/2, beamThickness/2]
 
 //top beam SOUTH
 o := l._3d.getObject("topPlate").getObject("topBeamSouth")
 o.jointLowerLimit := startAngle
 o.jointUpperLimit := endAngle
 o.scale := [lengthScale, thickScale, thickScale]
 o.aniRotationCenter := mainRotCenter --[beamLength/2*-1, 0, 0]
 o.position[2] := -(topWidth/2) + beamThickness/2 + beamTolerance
 --lower beam
 setLowerBeamParameters(o)
 
 
 //top beam SOUTH MOVING
 o := l._3d.getObject("topPlate").getObject("topBeamSouthMoving")
 o.jointLowerLimit := startAngle
 o.jointUpperLimit := endAngle
 o.scale := [lengthScale, thickScale, thickScale]
 o.aniRotationCenter := mainRotCenter
 o.position[2] := -(topWidth/2) + beamThickness/2 + beamTolerance
 --lower beam
 setLowerBeamParameters(o)
 
 //top beam NORTH
 o := l._3d.getObject("topPlate").getObject("topBeamNorth")
 o.jointLowerLimit := startAngle
 o.jointUpperLimit := endAngle
 o.scale := [lengthScale, thickScale, thickScale]
 o.aniRotationCenter := mainRotCenter
 o.position[2] := (topWidth/2) - beamThickness/2 - beamtolerance
 --lower beam
 setLowerBeamParameters(o)
 
 //top beam NORTH MOVING
 o := l._3d.getObject("topPlate").getObject("topBeamNorthMoving")
 o.jointLowerLimit := startAngle
 o.jointUpperLimit := endAngle
 o.scale := [lengthScale, thickScale, thickScale]
 o.aniRotationCenter := mainRotCenter
 o.position[2] := (topWidth/2) - beamThickness/2 - beamTolerance
 --lower beam
 setLowerBeamParameters(o)
 
 /*
 o := o.getObject("lowerBeam")
 o.jointLowerLimit := startAngle*-2
 o.jointUpperLimit := endAngle*-2
 o.aniRotationCenter := lowerRotCenter
 o.position[2] := 0
 */
 
 
 
 /*
 //third angle
 o := o.getObject("topPlate")
 --joint
 o.jointLowerLimit := startAngle*-1
 o.jointUpperLimit := endAngle*-1 --asin((exitHeight+beamThickness)/amountJoints/beamlength)*180/pi * -1 --endAngle*-1
 o.jointVelocity := spd
 --o.position[3] := diffHeight
 */
 
 /*
 //top plate for mu movement
 var plateLength := 3 --o.
 o := o.getObject("muPosition")
 o.jointVelocity := plateLength/2/loadAndUnloadTime
 */
